    return(
       <div className='ma3 mt0'>
            <Tilt className="Tilt br2 shadow-2" options={{ max : 55 }} style={{ height: 150, width: 150 }} >
                <div className="Tilt-inner pa3"> <img alt='logo' src={Brain}/> </div>
            </Tilt>
       </div>
    );
}

export default ImageLinkForm;
